% 清除环境
clc; clear; close all;

% --- 场景 1: 简单的长方体刚体 ---
% % 假设一个长方体: 宽=0.2, 高=0.8, 深=0.4, 质量=10kg
m = 10;
% w=0.2; h=0.8; d=0.4;
% % 计算理论惯量 (对角阵)
% Ixx = m/12 * (h^2 + d^2);
% Iyy = m/12 * (w^2 + d^2);
% Izz = m/12 * (w^2 + h^2);

% I_tensor = [0.1, -0.1, 0.01; 
%             -0.1, 0.5, 0.001; 
%             0.01, 0.001, 0.5];
% I_tensor = [0.1, -0.1, 0.0; 
%            -0.1, 0.5, 0.0; 
%            0.0, 0.0, 0.5];

% 惯量张量矩阵（负张量记数法）
I_tensor = [101379.14,  -41959.47,  -79913.38;
           -41959.47, 364468.83,  -25280.29;
           -79913.38,  -25280.29, 347176.84]*1e-8;

com = [0, 0, 0];

figure('Name', 'Scenario 1: Simple Box'); %[output:548ce283]
visualizeInertia(m, com, I_tensor); %[output:548ce283]
hold on %[output:548ce283]

% partTest = importrobot(".\modernRobot\part\parttest\urdf\parttest.urdf");
% partTest.show()
% % --- 场景 2: 旋转的复杂惯量 (带非对角项) ---
% % 假设上述物体绕 Z 轴旋转了 45 度
% theta = pi/4;
% R = [cos(theta) -sin(theta) 0; sin(theta) cos(theta) 0; 0 0 1];
% % 旋转后的惯量张量 I_new = R * I * R'
% I_rotated = R * I_tensor * R';
% com_shifted = [0.5, 0.5, 0.5];
% 
% figure('Name', 'Scenario 2: Rotated Inertia at Offset CoM');
% visualizeInertia(m, com_shifted, I_rotated, 'BoxAlpha', 0.5);
%%
%% --- 动画与交变力偶及其X轴投影演示 ---

% 1. 获取可视化对象的句柄
patches = findobj(gca, 'Type', 'patch');
if isempty(patches)
    error('未找到惯性盒子对象，请确保 visualizeInertia 已正确绘制了 patch。');
end
h_box = patches(1);
original_vertices = h_box.Vertices;

% 计算力偶的作用点距离
z_max = max(abs(original_vertices(:,3))); 
if z_max < 1e-3, z_max = 0.5; end 
L_arm = z_max * 1.2; 

% 2. 初始化绘图元素
hold on; %[output:0c33eb47]

% --- 基础元素 ---
% 旋转轴 (绿色)
quiver3(0, 0, -L_arm*1.5, 0, 0, L_arm*3, 'g', 'LineWidth', 1, 'DisplayName', 'Axis \omega'); %[output:0c33eb47]
% 绘制连接杆 (黑色虚线)
plot3([0,0], [0,0], [-L_arm, L_arm], 'k--', 'LineWidth', 1.5); %[output:0c33eb47]

% --- 真实力偶 (旋转的) ---
% Top Force (红色)
h_force_top = quiver3(0, 0, L_arm, 0, 0, 0, 'r', 'LineWidth', 2.5, 'MaxHeadSize', 0.5, 'DisplayName', 'Real Force (Top)'); %[output:0c33eb47]
% Bottom Force (蓝色)
h_force_bot = quiver3(0, 0, -L_arm, 0, 0, 0, 'b', 'LineWidth', 2.5, 'MaxHeadSize', 0.5, 'DisplayName', 'Real Force (Bot)'); %[output:0c33eb47]

% --- X轴投影力偶 (伸缩的) ---
% Top Projection (品红色 - X分量)
h_proj_top = quiver3(0, 0, L_arm, 0, 0, 0, 'm', 'LineWidth', 2, 'MaxHeadSize', 0.5, 'DisplayName', 'X-Proj (Top)'); %[output:0c33eb47]
% Bottom Projection (青色 - X分量)
h_proj_bot = quiver3(0, 0, -L_arm, 0, 0, 0, 'c', 'LineWidth', 2, 'MaxHeadSize', 0.5, 'DisplayName', 'X-Proj (Bot)'); %[output:0c33eb47]

% --- 投影辅助线 (连接真实力尖端到投影尖端) ---
h_line_top = plot3([0,0], [0,0], [0,0], 'k:', 'LineWidth', 0.5); %[output:0c33eb47]
h_line_bot = plot3([0,0], [0,0], [0,0], 'k:', 'LineWidth', 0.5); %[output:0c33eb47]

% 文字标签
h_text = text(0, 0, L_arm + 0.3, '', 'FontSize', 12, 'BackgroundColor', 'w'); %[output:0c33eb47]

% 设置视图
view(120, 25); % 稍微调整视角以便看清X轴投影 %[output:0c33eb47]
grid on; axis equal; %[output:0c33eb47]
limit = max(0.3, L_arm * 1);
xlim([-limit, limit]); ylim([-limit, limit]); zlim([-limit, limit]); %[output:0c33eb47]
xlabel('X (Projection Axis)'); ylabel('Y'); zlabel('Z'); %[output:0c33eb47]
title('Dynamic Simulation: Force Couple & X-Axis Projection'); %[output:0c33eb47]
legend([h_force_top, h_proj_top], {'Total Force (Rotating)', 'X-Projection (Oscillating)'}, 'Location', 'northeast'); %[output:0c33eb47]

disp('开始动画... 注意观察品红色箭头做简谐振动 (按 Ctrl+C 停止)'); %[output:2ecf5a71]

% 3. 动画循环
fps = 30;
dt = 1/fps;
total_time = 10; % 延长时间方便观察
omega_mag = 5;

omega_vec = [0; 0; omega_mag];
k_vec = [0; 0; 1]; 

% 定义力的大小缩放系数 (根据需要调整)
force_scale = -1.0; % 调整此值以获得合适的箭头长度视觉效果

for t = 0:dt:total_time %[output:group:61bbfb37]
    if ~isvalid(h_box), break; end
    
    % --- A. 运动学更新 ---
    theta = omega_mag * t;
    R = [cos(theta), -sin(theta), 0;
         sin(theta),  cos(theta), 0;
         0,           0,          1];
     
    h_box.Vertices = (R * original_vertices')'; %[output:0c33eb47]
    
    % --- B. 动力学计算 ---
    I_global = R * I_tensor * R';       
    L_vec = I_global * omega_vec;       
    tau_vec = cross(omega_vec, L_vec);  
    
    % --- C. 力偶分解 ---
    F_vec = cross(tau_vec, k_vec) / (2 * L_arm);
    
    % 计算用于绘图的矢量分量
    U = F_vec(1) * force_scale; % X 分量
    V = F_vec(2) * force_scale; % Y 分量
    W = F_vec(3) * force_scale; % Z 分量 (通常为0)
    
    % --- D. 可视化更新 ---
    
    % 1. 更新真实力 (红/蓝 - 旋转)
    set(h_force_top, 'UData', U, 'VData', V, 'WData', W);
    set(h_force_bot, 'UData', -U, 'VData', -V, 'WData', -W);
    
    % 2. 更新X轴投影力 (品红/青 - 仅X方向伸缩)
    % VData 和 WData 设为 0，只保留 UData (X分量)
    set(h_proj_top, 'UData', U, 'VData', 0, 'WData', 0);
    set(h_proj_bot, 'UData', -U, 'VData', 0, 'WData', 0);
    
    % 3. 更新辅助虚线 (连接真实箭头尖端 -> 投影箭头尖端)
    % 顶部虚线: 从 (0+U, 0+V, L) 到 (0+U, 0, L)
    set(h_line_top, 'XData', [U, U], ...
                    'YData', [V, 0], ...
                    'ZData', [L_arm, L_arm]);
    
    % 底部虚线: 从 (0-U, 0-V, -L) 到 (0-U, 0, -L)
    set(h_line_bot, 'XData', [-U, -U], ...
                    'YData', [-V, 0], ...
                    'ZData', [-L_arm, -L_arm]);
              
    % 4. 更新文字
    force_mag = norm(F_vec);
    force_x = abs(F_vec(1));
    set(h_text, 'String', sprintf('Total Force: %.1f N\nX-Project: %.1f N', force_mag, force_x));
            
    drawnow limitrate; 
    pause(0.01);
end %[output:group:61bbfb37]

